  while (p1 != null) {
    p2 = p2.next as ListNode;
    p1 = p1.next as ListNode;
  }

  // p2 \u73B0\u5728\u6307\u5411\u7B2C n-k+1 \u4E2A\u8282\u70B9\uFF0C\u5373\u5012\u6570\u7B2C k \u4E2A\u8282\u70B9
  return p2;
